import React, { Component } from 'react';
import { Row, Col, Container, Form, Image, Button, Nav } from 'react-bootstrap';

// import { Row, Col, Container, Form, Image, Button } from 'react-bootstrap';
// import imgLogoSezonaPocetna from './imgPretragaPocetna/sezona-logo.png';

import './FooterPocetna.css';

export default class FooterPocetna extends Component {
	render() {
		return (
			<React.Fragment>
				<Container fluid>
					<Row className="position-footer-pocetna">
						<Col className="drzava-footer-pocetna">
							<h5 className="drzava-naslov-footer-pocetna">Bosna i Hercegovina</h5>
						</Col>
					</Row>
					<Row className="position-sub-footer-pocetna">
						<Nav className="justify-content-bettwen" activeKey="/home">
							<Nav.Item>
								<Nav.Link href="/home">Active</Nav.Link>
							</Nav.Item>
							<Nav.Item>
								<Nav.Link eventKey="link-1">Link</Nav.Link>
							</Nav.Item>
							<Nav.Item>
								<Nav.Link eventKey="link-2">Link</Nav.Link>
							</Nav.Item>
							<Nav.Item>
								<Nav.Link eventKey="disabled" disabled>
									Disabled
								</Nav.Link>
							</Nav.Item>
						</Nav>
					</Row>
				</Container>
			</React.Fragment>
		);
	}
}
